import logo from './logo/kickstartlogo.png'
import Formulario from './Formulario';

ReactDOM.render(
	<React.StrictMode>
		<div className="container-">             
                
            <Formulario />
                                
                          

		</div>
	</React.StrictMode>,
	document.getElementById('root')
);
